import React from 'react';
import Product from './components/Product'
import './css/Product.css'
const App =() =>{
    return(
        <div className="product-list">
            <Product price="2000" name="phone"/>
            <Product price="3000" name="phone"/>
            <Product price="4000" name="phone"/>
            <Product price="5000" name="phone"/>
            <Product price="6000" name="phone"/>
            <Product price="7000" name="phone"/>


        </div>
    );
}

export default App;
